import React from 'react';
import Link from 'react-router-dom';
// import { ReactComponent } from '*.svg';

const Attorneys = (props) => (
    <section className="mw7-ns mw6-m mw5 lh-copy center">
    <h2> Attorney Profiles </h2>
    <ul className="bullet-list">
        <li><Link to="/portfolio">Corren</Link></li>
        <li><Link to="//behance.net/steinrock" target="_blank" rel="noopener noreferrer"> Behance </Link>This uses Behance API</li>
    </ul>
    </section>
)

export default Attorneys;
